import axios from "axios"
import { useState, useEffect } from "react";



function App() {

  const [info, setInfo] = useState({})
  const [ location, setLocation] = useState()
  const url = `https://api.openweathermap.org/data/2.5/weather?q=${location}&appid=dbfc58248986c6dec618446e83e49191`

 useEffect(()=> {
  axios.get(url).then((resp) => {
    // setInfo(resp.data)
    console.log(resp.data)
  })
 }, [])


  return (
    <div className="app">
      <div className="container">
        <div className="top">
            <div className="location">
              <p>Dallas</p>
            </div>
            <div className="temp">
              <h1>65ËšC</h1>
            </div> 
            <div className="description">
              <p>Clouds</p>
            </div>
        </div>
        <div className="bottom">
          <div className="feels">
            <p className="bold">60</p>
            <p>Feels like</p>
          </div> 
          <div className="humidity">
            <p className="bold">20%</p>
            <p>Humidity</p>
          </div>
          <div className="wind">
            <p className="bold">12kmh</p>
            <p>Wind Speed</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
